import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import SideBar from './Component/sidebar';
import main from './Component'

function App() {
  return (
    <BrowserRouter>
      <Routes element={<main/>}>
        <Route path="/" element={<SideBar />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
